       vnode = lto_varpool_encoder_deref (varpool_encoder, i);
+      if (vnode->alias)
+	continue;
       write_symbol (cache, &stream, vnode->decl, seen, false);
       for (valias = vnode->extra_name; valias; valias = valias->next)
